import React from 'react'
import logo from './LOGO.svg'
import classes from './Logo.module.css'

const Logo = () => {
  return (
    <div className="main-header-left">
      <img src={logo} alt="" className={classes.Logo} />
    </div>
  )
}

export default Logo;
